import actiontypes from "./actiontypes";

const initState = null

const Reducer = (state = initState, action) => {
    switch(action.type) {
        case actiontypes().productCatalog.set:
            state = action.payload
            return state

        default:
            return state
    }
}

export default rootReducer;
